import React from 'react';

const CreateCourse = () => {
  return (
    <div className="container">
      <h1>Create New Course</h1>
      <div className="card">
        <p>Course creation functionality coming soon!</p>
        <p>Instructors will be able to create courses with videos, assignments, and exams here.</p>
      </div>
    </div>
  );
};

export default CreateCourse;
